async function copyImage(url) {
  try {
    const response = await fetch(url);
    if (!response.ok) {
      throw new Error("Failed to fetch image");
    }
    const blob = await response.blob();
    const img = document.createElement("img");
    img.src = URL.createObjectURL(blob);
    await new Promise((resolve) => {
      img.onload = resolve;
    });
    const canvas = document.createElement("canvas");
    canvas.width = img.width;
    canvas.height = img.height;
    const ctx = canvas.getContext("2d");
    ctx.drawImage(img, 0, 0);
    const pngBlob = await new Promise((resolve) =>
      canvas.toBlob(resolve, "image/png")
    );
    const data = new ClipboardItem({ "image/png": pngBlob });
    await navigator.clipboard.write([data]);
    await actions.showAlert("success", "Image copied to clipboard");
  } catch (err) {
    console.error("Failed to copy image: ", err);
    await actions.showAlert("error", "Failed to copy image: " + err.message);
  }
}

copyImage(variables.fileUrl);

function downloadImageFromURL(url, filename = "image") {
  const validExtensions = ["png", "jpg", "gif", "svg"];
  const fileExtension = filename.split(".").pop().toLowerCase();
  if (!validExtensions.includes(fileExtension)) {
    console.error(
      "Invalid file format. Supported formats are: png, jpg, gif, svg."
    );
    throw new Error(
      "Invalid file format. Please use a supported image format."
    );
  }
  fetch(url)
    .then((response) => response.blob())
    .then((blob) => {
      const blobUrl = URL.createObjectURL(blob);
      const link = document.createElement("a");
      link.href = blobUrl;
      link.download = filename;
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
      URL.revokeObjectURL(blobUrl);
    })
    .catch((error) => {
      console.error("Error downloading the image:", error);
    });
}
